query DB for unknown number of params<p>Here is a simple express router, I want to give it query params and search the DB for them.</p>

<p>so, if the URL is like this <code>api?x=value1</code> the app should query the DB for <code>{ x:value1 }</code></p>

<p>if the URL is <code>api?x=value1&amp;y=value2</code>  the app should query the DB for <code>{ x:value1, y:value2 }</code></p>

<p>Since I don't know the number of params in advance, I have created an empty object and appended it with the params if existed.</p>

<p>if there are no params I want to retrieve all documents in DB.</p>

<pre><code>
 .get(function (req, res){

      let update_issue= {};     /*empty object*/

      if(req.query.issue_title){update_issue["issue_title"] = req.query.issue_title}
      if(req.query.issue_text){update_issue["issue_text"] = req.query.issue_text}
      if(req.query.created_by){ update_issue["created_by"] = req.query.created_by } 
           /*append object if param exists*/

      if(Object.keys(update_issue).length !== 0 ){  /*check if that object is not empty*/
        db.collection('issues').find(update_issue, (err, data)=&gt;{
          res.json(data);
          })
        }

      db.collection('issues').find().toArray((err, data)=&gt;{
        res.send(data);
      })
</code></pre>

<p>this solution keeps giving me  <code>TypeError: Converting circular structure to JSON</code>.</p>

