ClientSession requires a ServerSessionPool in Mongdb replicaset - NODEJS<p>I got the following error about mongo replica set and I did not find any docs about it</p>

<p><code>ClientSession requires a ServerSessionPool</code></p>

<p>I have multiple nodejs services using MongoDB node driver.</p>

<p>Does someone have any idea what can be the error? </p>

<p><code>Error: ClientSession requires a ServerSessionPool\n    at new ClientSession (/app/node_modules/mongodb/lib/core/sessions.js:73:13)\n    at ReplSet.startSession (/app/node_modules/mongodb/lib/topologies/topology_base.js:268:21)\n    at executeOperation (/app/node_modules/mongodb/lib/operations/execute_operation.js:49:26)\n    at Collection.&lt;anonymous&gt; (/app/node_modules/mongodb/lib/collection.js:1096:12)\n    at Collection.deprecated [as findOne] (/app/node_modules/mongodb/lib/utils.js:621:17)\n    at</code></p>

<p>I have 3 replicas set based on the following repo:
<a href="https://github.com/bitnami/bitnami-docker-mongodb" rel="nofollow noreferrer">https://github.com/bitnami/bitnami-docker-mongodb</a> </p>

<p>my mongo connection class:</p>

<pre><code>import { MongoClient } from 'mongodb'
import fs from 'fs'

export default class MongoService {
    constructor({ loggerFactory, configService }) {
        const mongoConf = configService.get('mongo')
        this.logger = loggerFactory.logger
        if(mongoConf != null) {
            this.mongoUrlFixed = configService.get('mongo.url')
            this.mongoNodeName = configService.get('mongo.mongo_node_name')
            this.mongoDbName = configService.get('mongo.mongo_db_name')
            this.logger.info('Mongodb configuration found')
        }
        this.configService = configService
    }

    async getConnection() {
        if(!this.mongoUrlFixed) {
            throw new Error('mongo is not configured for this service')
        }
        if(!this.conn) {
            let password_file_path = this.configService.get('mongo.mongo_user_password_file')
            let username = this.configService.get('mongo.mongo_user_username')

            if (fs.existsSync(password_file_path)) {
                let password = fs.readFileSync(password_file_path, 'utf8').replace(/\n$/, '')
                this.mongoUrl = `mongodb://${username}:${password}@${this.mongoNodeName}/${this.mongoDbName}?${this.mongoUrlFixed}`
            }
            try{
                await this.waitForMongo({timeout: 1000 * 60 * 2})

            } catch (err) {
                this.logger.error('An error occured while connecting to mongodb', err)
                process.exit(1)
            }
        }
        return this.conn
    }

    async waitForMongo(options) {
        return new Promise((resolve, reject) =&gt; {
            let timeouted = false 
            let timeoutHandler = setTimeout(() =&gt; {
                timeouted = true
                reject('TIMEOUTED_WAIT_FOR_MONGO')
            }, options.timeout) 

            let repeat = () =&gt; {
                setTimeout(async () =&gt; {
                    if(timeouted) return
                    try {
                        if(!this.mongoUrl)
                            this.conn = await MongoClient.connect(this.mongoUrlFixed, { useNewUrlParser: true })
                        else
                            this.conn = await MongoClient.connect(this.mongoUrl, { useNewUrlParser: true })
                    } catch (err) {
                        this.logger.debug('hanven\'t connected yet to mongodb', err)
                    }
                    if(!this.conn) {
                        setTimeout(repeat, 2000)
                    } else {
                        clearTimeout(timeoutHandler)
                        timeoutHandler = null
                        process.on('SIGINT', () =&gt; {
                            if(this.conn)
                                this.conn.close()
                        })
                        resolve()
                    }
                }, 2000) 
            }
            repeat()
        })
    }
}
</code></pre>

