How deep is too deep for embedded documents? Designing a voting app with MongoDB<p>I am designing my first MongoDB database (apologies if this is a simple question) for use in a voting application. The concept for the app is that users will be able to vote for their favorite song during the one contest per week, with each contest consisting of a set number of entries. </p>

<p>My thought so far is that each Entry will consist of an Artist and a Track. The Track could be pulled from the list of Tracks related to an Artist based on it being 'active', signified by an indicator variable. Votes will be stored in the Entry object, and each Entry object will belong to a Contest. Finally, each Contest will store X entries. </p>

<p>My question:</p>

<p>Would the Contest collection end up being too complicated or 'too embedded' if it contains, say, five Entries, each with their own Artist documents, each in turn with their own list of embedded Tracks? Like so.</p>

<pre><code>{
    _id: 'contest12345',
    winner: '',
    active: 1,
    startdate: '01162020',
    enddate: '01172020',
    entry1: {
        _id: 'artist1track1',
        votes: 0,
        artist: {
             _id: 'artist1',
             name: 'Artist 1',
             wins: 0,
             active: 1,
             tracks: [
                 { _id: 'track12345', title: 'Title 1', link: "https://soundcloud.com/artist1/track1", active: 1}, 
                 { _id: 'track12346', title: 'Title 2', link: "https://soundcloud.com/artist1/track2", active: 0} 
             ]
        }
    }, 
    entry2: {
        _id: 'artist2track1',
        votes: 0, 
        artist: { ... }
    }, 
    entry3: { ... },
    entry4: { ... },
    entry5: { ... }   
}
</code></pre>

<p>I've done some research, found a few questions that are similar but not specific to my questions but am unsure of what is considered "too deep". I think I understand what this <a href="https://docs.mongodb.com/manual/tutorial/model-embedded-one-to-many-relationships-between-documents/" rel="nofollow noreferrer">documentation</a> states, but am still unsure of what is ideal with MongoDB. </p>

<p>Any feedback is appreciated. </p>

